-- comune
create table firmip_d_comune
(
  id_comune          SERIAL,
  codice_istat       VARCHAR(6) not null,
  nome_comune        VARCHAR(50),
  codice_regione     VARCHAR(2),
  codice_provincia   VARCHAR(3),
  progressivo_comune VARCHAR(3),
  sigla_provincia    VARCHAR(2)
)
;
alter table firmip_d_comune
  add constraint PK_comune primary key (id_comune);


-- tipo_iniziativa
create table firmip_d_tipo_iniziativa
(
  id_tipo_iniziativa INTEGER not null,
  des_tipo_iniziativa VARCHAR(50)
)
;
alter table firmip_d_tipo_iniziativa
  add constraint PK_tipo_iniziativa primary key (id_tipo_iniziativa);


-- tipo_documento
create table firmip_d_tipo_documento
(
  tipo_documento VARCHAR(3) not null,
  nome_documento VARCHAR(50)
)
;
alter table firmip_d_tipo_documento
  add constraint PK_tipo_documento primary key (tipo_documento);


-- iniziativa
create table firmip_t_iniziativa
(
  id_iniziativa SERIAL,
  id_tipo_iniziativa INTEGER NOT NULL,
  titolo             VARCHAR(1000),
  data               DATE,
  anno               VARCHAR(20),
  fl_eliminata       CHAR(1) NOT NULL DEFAULT 'N'
)
;
alter table firmip_t_iniziativa
  add constraint PK_iniziativa primary key (id_iniziativa);
alter table firmip_t_iniziativa
  add constraint FK_tipo_iniziativa foreign key (id_tipo_iniziativa)
  references firmip_d_tipo_iniziativa (id_tipo_iniziativa);


-- firma_iniziativa
create table firmip_t_firma_iniziativa
(
  id_firma_iniziativa SERIAL,
  id_iniziativa  INTEGER,
  cognome        VARCHAR(100) not null,
  nome           VARCHAR(50) not null,
  data_nascita   DATE not null,
  luogo_nascita  VARCHAR(100) not null,
  tipo_documento VARCHAR(3),
  num_documento  VARCHAR(50),
  indirizzo      VARCHAR(200),
  id_comune      INTEGER,
  num_foglio     INTEGER
)
;
alter table firmip_t_firma_iniziativa
  add constraint PK_firma_iniziativa primary key (id_firma_iniziativa);
alter table firmip_t_firma_iniziativa
  add constraint FK_iniziativa foreign key (id_iniziativa)
  references firmip_t_iniziativa (id_iniziativa);
alter table firmip_t_firma_iniziativa
  add constraint FK_tipo_documento foreign key (tipo_documento)
  references firmip_d_tipo_documento (tipo_documento);
alter table firmip_t_firma_iniziativa
  add constraint FK_firma_iniziativa_comune foreign key (id_comune)
  references firmip_d_comune (id_comune);
-- AK1: id_iniziativa, cognome, nome, data_nascita, luogo_nascita
CREATE UNIQUE INDEX CONCURRENTLY ak1_firma_iniziativa_idx 
ON firmip_t_firma_iniziativa (id_iniziativa, cognome, nome, data_nascita, luogo_nascita);
ALTER TABLE firmip_t_firma_iniziativa 
ADD CONSTRAINT ak1_firma_iniziativa
UNIQUE USING INDEX ak1_firma_iniziativa_idx;

